import React, {Component} from 'react'
import PropTypes from 'prop-types'

export class Detail extends Component{
    static propTypes ={
        id: PropTypes.string
    }

    _fetchMovie({id}) {
        fetch(`http://www.omdbapi.com/?apikey=${API_KEY}&i=${id}`)
            .then(res => res.json())
            .then(movie => {
                console.log({movie})
            })
    }

    comoponentDidMount () {
        const {id}= this.props
        this._fetchMovie({id})
    }


    render () {
        return (
            <p>Pagina de detalle</p>
        )
    }
}
